<!DOCTYPE html>
<html lang="en">
   <head>
      <meta charset="UTF-8" />
      <!--Let browser know website is optimized for mobile-->
      <meta name="viewport" content="width=device-width, initial-scale=1.0" />
      <meta property="og:image" content="https://hotdogishot.github.io/PCompiler/media/thumbnail.jpg">
      <meta property="og:image:type" content="image/jpg">
      <meta property="og:image:width" content="1024">
      <meta property="og:image:height" content="1024">
      <link rel="icon" type="image/png" sizes="16x16" href="https://hotdogishot.github.io/PCompiler/media/favicon.png">
      <title>Download PCompiler</title>
      <!--Import stylesheets -->
      <link href="//fonts.googleapis.com/css?family=Roboto:300,300i,400,400i,500,500i,700,700i|Roboto+Mono:300,400,500|Google+Sans:400,500,700|Material+Icons|Google+Sans+Display:400,500,700|Google+Sans+Text+Beta:400,500,700,400i,500i,700i" rel="stylesheet">
      <link href="https://hotdogishot.github.io/PCompiler/lib/material-components-web/material-components-web.min.css" rel="stylesheet">
      <link rel="stylesheet" href="https://hotdogishot.github.io/PCompiler/css/style.css">
      <!-- Required JavaScript library  -->
      <script type="text/javascript" src="https://hotdogishot.github.io/PCompiler/lib/material-components-web/material-components-web.min.js"></script>
      <script type="text/javascript" src="https://hotdogishot.github.io/PCompiler/lib/vue.min.js"></script>
      <style>
         .download-label .material-icons {
         vertical-align:-30%;
         font-size: 21px;
         }
         .mdc-linear-progress__buffer-bar {
         background-color: var(--mdc-theme-background);
         }
         .center {
         position: absolute;
         top: 50%;
         left: 50%;
         transform: translate(-50%, -50%);
         }
         .card {
         width: 700px;
         height: 250px;
         background-color: var(--mdc-theme-surface);
         border-radius: 4px;
         border: 1px solid var(--mdc-theme-light);
         }
         .card--content {
         padding: 16px;
         width: calc(100% - 125px);
         position: fixed;
         left: 125px;
         }
         .card--banner {
         position: fixed;
         left: 0;
         width: 125px;
         border-right: 1px solid var(--mdc-theme-light);
         height: 100%;
         }
         .card--content .download-indicator,
         .card--content .download-indicator .download-label {
         margin: 10px 0;
         }
         .card--action {
         position: absolute;
         right: 0;
         bottom: 0;
         margin: 15px;
         }
      </style>
   </head>
   <header class="mdc-top-app-bar">
      <div class="mdc-top-app-bar__row">
         <section class="mdc-top-app-bar__section mdc-top-app-bar__section--align-start">
            <a><img draggable="false" src="https://hotdogishot.github.io/PCompiler/media/logo.webp" width="32" alt="rubik's cube"></a>
            <span class="mdc-top-app-bar__title">Pascal Compiler Web Version v1.0</span>
         </section>
         <section class="mdc-top-app-bar__section mdc-top-app-bar__section--align-end" role="toolbar">
            <a href="https://github.com/Hotdogishot" target="_blank" class="mdc-icon-button material-icons">
               <svg width="1024" height="1024" viewBox="0 0 1024 1024" xmlns="http://www.w3.org/2000/svg">
                  <path fill="var(--mdc-theme-text-primary-on-background)"  fill-rule="evenodd" clip-rule="evenodd" d="M8 0C3.58 0 0 3.58 0 8C0 11.54 2.29 14.53 5.47 15.59C5.87 15.66 6.02 15.42 6.02 15.21C6.02 15.02 6.01 14.39 6.01 13.72C4 14.09 3.48 13.23 3.32 12.78C3.23 12.55 2.84 11.84 2.5 11.65C2.22 11.5 1.82 11.13 2.49 11.12C3.12 11.11 3.57 11.7 3.72 11.94C4.44 13.15 5.59 12.81 6.05 12.6C6.12 12.08 6.33 11.73 6.56 11.53C4.78 11.33 2.92 10.64 2.92 7.58C2.92 6.71 3.23 5.99 3.74 5.43C3.66 5.23 3.38 4.41 3.82 3.31C3.82 3.31 4.49 3.1 6.02 4.13C6.66 3.95 7.34 3.86 8.02 3.86C8.7 3.86 9.38 3.95 10.02 4.13C11.55 3.09 12.22 3.31 12.22 3.31C12.66 4.41 12.38 5.23 12.3 5.43C12.81 5.99 13.12 6.7 13.12 7.58C13.12 10.65 11.25 11.33 9.47 11.53C9.76 11.78 10.01 12.26 10.01 13.01C10.01 14.08 10 14.94 10 15.21C10 15.42 10.15 15.67 10.55 15.59C13.71 14.53 16 11.53 16 8C16 3.58 12.42 0 8 0Z" transform="scale(64)" fill="#1B1F23"/>
               </svg>
            </a>
         </section>
      </div>
   </header>
   <body class="theme--light">
      <main id="app" class="mdc-top-app-bar--fixed-adjust">
         <div class="card center">
            <div class="card--banner">
               <div class="card--logo center">
                  <img draggable="false" src="https://hotdogishot.github.io/PCompiler/media/logo.webp" width="65" alt="rubik's cube"/>
               </div>
            </div>
            <div class="card--content">
               <table>
                  <tr>
                     <td><b>Filename: </b></td>
                     <td>{{ filename }}</td>
                  </tr>
                  <tr>
                     <td><b>Size: </b></td>
                     <td>{{ size }}</td>
                  </tr>
                  <tr>
                     <td><b>Version: </b></td>
                     <td>{{ version }}</td>
                  </tr>
                  <tr>
                     <td><b>Architecture: </b></td>
                     <td>{{ architecture }}</td>
                  </tr>
               </table>
               <div class="download-indicator">
                  <div role="progressbar" class="mdc-linear-progress" aria-valuemin="0" aria-valuemax="100" aria-valuenow="0">
                     <div class="mdc-linear-progress__buffer">
                        <div class="mdc-linear-progress__buffer-bar"></div>
                        <div class="mdc-linear-progress__buffer-dots"></div>
                     </div>
                     <div class="mdc-linear-progress__bar mdc-linear-progress__primary-bar">
                        <span class="mdc-linear-progress__bar-inner"></span>
                     </div>
                     <div class="mdc-linear-progress__bar mdc-linear-progress__secondary-bar">
                        <span class="mdc-linear-progress__bar-inner"></span>
                     </div>
                  </div>
                  <span class="mdc-typography--overline">
                  <span class="mdc-typography--overline" ref="dwnlded">0 KB</span> / {{ size }}
                  </span>
                  <table class="download-label">
                     <tr>
                        <td><span class="material-icons mdc-theme--success" style="transform: rotate(90deg)">sync_alt</span></td>
                        <td><span class="mdc-typography--overline" ref="rate">0 KB / s</span></td>
                        <td>&nbsp</td>
                        <td>&nbsp</td>
                        <td>&nbsp</td>
                        <td><span class="material-icons mdc-theme--success">schedule</span></td>
                        <td><span class="mdc-typography--overline" ref="remaining">00:00:00</span></td>
                     </tr>
                  </table>
               </div>
            </div>
            <div class="card--action">
               <button class="mdc-button mdc-button--outlined" ref="dwnldbtn" v-on:click="download()">
               <span class="mdc-button__ripple"></span>
               <span class="material-icons mdc-button__icon">get_app</span>
               <span clas="mdc-button__label">Download</span>
               </button>
            </div>
         </div>
         </div>
         <div class="mdc-snackbar">
         <div class="mdc-snackbar__surface" role="status" aria-relevant="additions">
            <div class="mdc-snackbar__label" aria-atomic="false">
               Can't connect to server. Retry in 5 seconds.
            </div>
            <div class="mdc-snackbar__actions" aria-atomic="true">
               <button type="button" class="mdc-button mdc-snackbar__action">
                  <div class="mdc-button__ripple"></div>
                  <span class="mdc-button__label">Dismiss</span>
               </button>
            </div>
         </div>
      </main>
